import React from 'react'

const Note = ({ note, onClick }) => {
  return (
    <div>
      <li>{note.content}
        <button value={note} onClick={onClick}>{note.important ? 'Make not important' : 'Make important'}</button>
      </li>
    </div>
  )
}

export default Note
